import React from 'react'

function ProjectCards({data}) {
  return (
    <>
        <div className="row">
            {data && data.map(({id,image,title,location})=>(
                <div className='col-12 col-md-5 col-lg-4' key={id}>
                    <div className="img">
                        <img src={`${baseUrl}/${image}`} alt="" />
                    </div>
                </div>
            ))}
        </div>
    </>
  )
}

export default ProjectCards
